import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 56-54.2 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/56-54.2.md","filePath":"vacode/56-54.2.md"}'),n={name:"vacode/56-54.2.md"},i=o('<h1 id="§-56-54-2-definitions" tabindex="-1">§ 56-54.2 Definitions. <a class="header-anchor" href="#§-56-54-2-definitions" aria-label="Permalink to &quot;§ 56-54.2 Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context requires a different meaning:</p><p>&quot;Competitive local exchange telephone company&quot; means (i) a competing telephone company, excluding a city, town, or county, that was granted a certificate on or after January 1, 1996, pursuant to § <a href="http://law.lis.virginia.gov/vacode/56-265.4:4/" target="_blank" rel="noreferrer">56-265.4:4</a> or (ii) an incumbent local exchange telephone company to the extent such company is providing service outside of its incumbent territory.</p><p>&quot;Competitive telephone company&quot; means (i) an incumbent local exchange telephone company whose residential dial tone lines (a) were deemed competitive by the Commission throughout the company&#39;s incumbent service territory prior to January 1, 2014, or (b) are declared competitive by the Commission throughout its incumbent service territory on or after January 1, 2014, in a proceeding pursuant to § <a href="http://law.lis.virginia.gov/vacode/56-235.5/" target="_blank" rel="noreferrer">56-235.5</a> or (ii) a competitive local exchange telephone company.</p><p>&quot;Incumbent local exchange telephone company&quot; means a public service corporation that was providing local exchange telephone service prior to January 1, 1996, or a successor entity to such a public service corporation.</p><p>&quot;Incumbent territory&quot; means the area in which an incumbent local exchange telephone company was providing local exchange telephone service prior to July 1, 2002, except as its incumbent certificate may have been amended by the Commission after that date pursuant to subdivision B 1 of § <a href="http://law.lis.virginia.gov/vacode/56-265.4:4/" target="_blank" rel="noreferrer">56-265.4:4</a>.</p><p>2014, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0340" target="_blank" rel="noreferrer">340</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0376" target="_blank" rel="noreferrer">376</a>.</p>',7),r=[i];function c(s,p,l,h,u,m){return t(),a("div",null,r)}const f=e(n,[["render",c]]);export{g as __pageData,f as default};
